import s from './style.module.css'

export function Settings() {
	return (
		<div className={s.container}>
			<div className={s.userInfo}>
				<div className={s.leftCtn}>
					<div className={s.birth}></div>
					<div className={s.preference}></div>
					<div className={s.description}></div>
				</div>
				<div className={s.rightCtn}></div>
			</div>
			<div className={s.photos}></div>
		</div>
	);
}
